import { StyleSheet, Text, View, SafeAreaView } from "react-native";
import { Image } from "expo-image";
const SessionScreen = () => {
  return (
    <SafeAreaView>
      <View style={[styles.groupParent, styles.groupParentFlexBox]}>
        <View style={styles.groupWrapper}>
          <Text style={styles.mySession}>My Sessions</Text>
          <Text style={[styles.history]}>History</Text>
        </View>
        <Image
          style={styles.noSession}
          contentFit="cover"
          source={require("../assets/no-session.svg")}
        />
      </View>
    </SafeAreaView>
  );
};

const styles = StyleSheet.create({
  groupParentFlexBox: {
    flexDirection: "row",
    position: "absolute",
    textAlign: "center",
  },
  groupParent: {
    width: "100%",
    height: 50,
  },
  groupWrapper: {
    flex: 1,
    flexDirection: "row",
    alignItems: "center",
    paddingHorizontal: 20,
    gap: 20,
  },
  mySession: {
    fontWeight: "bold",
  },
  noSession: {
    width: 220,
    height: 220,
    },
});
export default SessionScreen;
